import React, { useState } from "react";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";


export default function Nav() {

    const [open, setOpen] = useState(false);

    let menuBtnListener = () => {
        setOpen(!open);
        console.log("called")
    }

    if (open) {
        return (
            <nav>
                <div><Link to="/" onClick={menuBtnListener}>Logo</Link></div>
                <button onClick={menuBtnListener}>Menu</button>
                <ul>
                    <li>
                        <Link to="/ux-design">ux design</Link>
                        <span>ux research, strategy, and prototyping</span>
                    </li>
                    <li>
                        <a>visual design</a>
                        <span>ui design, graphic design, and branding</span>
                    </li>
                    <li>
                        <a>development</a>
                        <span>front end development and web apps</span>
                    </li>
                    <li>
                        <a>artwork</a>
                        <span>paintings, drawings, and illustrations</span>
                    </li>
                    <li>
                        <a>about</a>
                        <span>learn more about me</span>
                    </li>
                    <li>
                        <a>contact</a>
                        <span>find out how to reach me</span>
                    </li>
                </ul>
            </nav>
        );
    } else {
        return (

            <nav>
                <div><Link to="/">Logo</Link></div>
                <button onClick={menuBtnListener}>Menu</button>
            </nav>
         );
    }
}
